import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const HousingAdd = () => {
  const navigate = useNavigate();
  const House_API = 'http://26.90.237.200:3000/admin/house_type/add';

  const [addName, setAddName] = useState('');
  const [addNumDeed, setAddNumDeed] = useState('');
  const [addLandArea, setAddLandArea] = useState(0);


  const addHouse = async () => {
    const data = {
        addName: addName,
      addNumDeed: addNumDeed,
      addLandArea: addLandArea,

    };

    try {
      const response = await axios.post(House_API, data);
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
    navigate('/Housing');
  };

  return (
    <div className="container">
      <form>
        <div className="mb-3">
   
          <div>
            <label htmlFor="addHousePlan" className="form-label">
              แปลนบ้าน
            </label>
            <input
              type="text"
              className="form-control"
              id="addHousePlan"
              value={addHousePlan}
              onChange={(e) => setAddHousePlan(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addNumDeed" className="form-label">
              เลขที่โฉนด
            </label>
            <input
              type="text"
              className="form-control"
              id="addNumDeed"
              value={addNumDeed}
              onChange={(e) => setAddNumDeed(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addLandArea" className="form-label">
              ขนาดพื้นที่
            </label>
            <input
              type="number"
              className="form-control"
              id="addLandArea"
              value={addLandArea}
              onChange={(e) => setAddLandArea(parseInt(e.target.value))}
            />
          </div>
          <div>
            <label htmlFor="addPrice" className="form-label">
              ราคา
            </label>
            <input
              type="number"
              className="form-control"
              id="```jsxaddPrice"
              value={addPrice}
              onChange={(e) => setAddPrice(parseInt(e.target.value))}
            />
          </div>
        </div>
        <button type="button" className="btn btn-primary" onClick={addHouse}>
          เพิ่มบ้าน
        </button>
      </form>
    </div>
  );
};

export default HousingAdd;
